import React from "react";
import "./login.scss";

function Login() {
  return (
    <div>
      <div className="login">
        <div className="main-login">
          <h1>Login</h1>
          <hr />
          <form>
            <input type="email" placeholder="Email" />
            <input type="password" placeholder="Password" />
            <button>Login</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Login;
